style.css:
@-moz-document domain("roblox.com") {
/* Apply background image to body and html */
    body, html {
        background: url('data:image/jpeg;base64,') fixed no-repeat center center / cover !important;
        min-height: 100vh !important;
        color: #ffffff !important; /* default text color */
    }

    /* Ensure the background covers the entire viewport */
    body {
        min-height: 100vh !important;
        background-attachment: fixed !important;
        background-size: cover !important;
    }

    /* Ensure all other containers have transparent backgrounds */
    .container, .main-content, .header, .footer, .container-lg, .content, .page-container, .page-content {
        background-color: transparent !important;
        color: #ffffff !important; /* white */
    }

    /* General text and headings */
    p, h1, h2, h3, h4, h5, h6, .text, .label {
        color: #ffffff !important; /* white */
    }

    /* Links */
    a {
        color: #00bfff !important; /* deep sky blue */
    }

    a:visited {
        color: #1e90ff !important; /* dodger blue */
    }

    /* Main containers */
    .container, .main-content, .header, .footer, .container-lg, .content {
        background-color: rgba(0, 0, 0, 0.6) !important; /* semi-transparent black */
        color: #ffffff !important; /* white */
    }

    /* Buttons */
    .btn-primary, .btn-secondary, .btn-action {
        background-color: #1e90ff !important; /* dodger blue */
        color: #ffffff !important; /* white */
        border-color: #1e90ff !important;
    }

    .btn-secondary, .btn-neutral {
        background-color: #00bfff !important; /* deep sky blue */
        color: #ffffff !important; /* white */
        border-color: #00bfff !important;
    }

    /* Input fields and text areas */
    input, textarea {
        background-color: rgba(255, 255, 255, 0.2) !important; /* semi-transparent white */
        color: #ffffff !important; /* white */
        border-color: #1e90ff !important;
    }

    /* Sidebar */
    .sidebar, .sidebar-container {
        background-color: rgba(0, 0, 0, 0.7) !important; /* semi-transparent black */
        color: #ffffff !important; /* white */
    }

    /* Darken dropdown menus */
    .dropdown-menu {
        background-color: rgba(0, 0, 0, 0.8) !important; /* darker semi-transparent black */
        color: #ffffff !important; /* white */
    }

    /* Navbar */
    .navbar, .nav-menu {
        background-color: rgba(0, 0, 0, 0.6) !important; /* semi-transparent black */
        color: #ffffff !important; /* white */
    }

    /* Ensure other containers don't override the background */
    .content, .page-container, .page-content {
        background: transparent !important;
    }
}
